import React, { Component } from 'react'


class Maps extends Component {

    constructor() {
        super();
        this.state = {
            car: ['bmw', 'benz', 'tata'],
            party: { name: 'bjp', rivals: 'congress'}
        }

    }
    render() {
        return (
            <div>
                <table className='table-info'>
                    <tr>
                        <th>Number</th>
                        <th>Party Name</th>
                    </tr>

                    {
                        this.state.party.map((i, k) => {
                            return (
                                <tr>
                                    <td>{i.name}</td>
                                    <td>{i.rivals}</td>
                                </tr>
                            )
                        })
                    }


                </table>
            </div>
        )
    }
}

export default Maps;
